const char* unicode_to_ascii(unsigned unicode) {

#ifndef NDEBUG
	/* 
	 * use of local static variable is a tricks to check table is sorted only on first call ( when local 
	 * variable is initialized ) to not slowdown too much debug.
	 */
	static bool is_sorted = std::is_sorted(std::begin(translate_table), std::end(translate_table), 
		[](const translate_pair_t& a, const translate_pair_t& b) {
			return a.first < b.first;
		});
	assert(is_sorted);
#endif		

	// translate_table is sorted so we can do a binary search using lower_bound.
	auto it = std::lower_bound(std::begin(translate_table), std::end(translate_table), unicode, 
		[](const translate_pair_t& item, translate_pair_t::first_type data) {
			return item.first < data;
		});

	if (it != std::end(translate_table) && it->first == unicode) {
		return it->second;
	}
	return nullptr;
}
